import React, { useState, useEffect } from 'react';
import '../styles/pages/HomeStyle.css';
import Navbar from '../components/Navbar';
import MyGoogleMap from '../components/GoogleMap';

function HomePage() {
    // State to store the fetched data
    const [userData, setUserData] = useState(null);

    // Function to make the GET request and fetch user data
    useEffect(() => {
        const fetchUserData = async () => {
            try {
                const response = await fetch('http://your-api-endpoint.com/user-data', {
                    method: 'GET',
                    // Add any necessary headers (e.g., Authorization header for authentication)
                });

                if (response.status === 200) {
                    const data = await response.json();
                    setUserData(data); // Store the fetched data in state
                } else {
                    console.error('Error fetching user data');
                }
            } catch (error) {
                console.error('Error:', error);
            }
        };

        // Call the fetchUserData function when the component mounts
        fetchUserData();
    }, []);

    return (
        <div className="home-container">
            <Navbar className="navbar" />

            {/* Separate div for the map */}
            <div className="map-container">
                <MyGoogleMap />
            </div>

            {/* Display the fetched user data */}
            {userData && (
                <div className="user-data">
                    <h2>User Data</h2>
                    <p>Name: {userData.name}</p>
                    <p>Email: {userData.email}</p>
                    {/* Add more fields as needed */}
                </div>
            )}
        </div>
    );
}

export default HomePage;
